INSERT INTO `daily_supervisors` VALUES(1, '2010-11-19', -14, -21, 77, 'Mainly Clear', 'Thompson brought in 10 more guys', 'WMData49');
INSERT INTO `daily_supervisors` VALUES(2, '2010-11-20', -16, -20, 78, 'Variable cloudiness', '', 'WMData49');
INSERT INTO `daily_supervisors` VALUES(3, '2010-11-21', -23, -28, 76, 'Mainly clear', 'Conducted first Weekly Safety Meetings for day and night shifts. \r\nThompson Brothers worked in Kearl Opening Cut Area and Firebag Access. \r\n', 'WMData49');
INSERT INTO `daily_supervisors` VALUES(4, '2010-11-22', -22, -29, 70, 'Fells like -37 in morning', '•	Thompson Brothers (TB) completed the first night shift.  Fluor Safety and Construction Team members also worked the night shift. \r\n•	Fluor Safety inspected and approved four (4) pieces of TB mobile equipment. \r\n•	Additional TB manpower arrived Monday 22 November. \r\n•	Two Wellsite Masters employees are scheduled to arrive by car late Monday 22 November. \r\n•	TB worked in the Kearl Opening Cut Area and Firebag Access\r\n', 'WMData40');
INSERT INTO `daily_supervisors` VALUES(5, '2010-11-23', -16, -20, 70, 'Sunny', '• Two Wellsite Masters employees arrived by car. \r\n• TB worked in the Kearl Opening Cut Area and Firebag Access. \r\n• A TB portable light plant (in tow by a light truck)  was damaged while it was being backed into position.  The damage was caused by the hitch mechanism on the trailer contacting the receiver on the truck.  Procedures were being followed including a spotter.  The truck stopped immediately and the light plant was secured.  Personnel were not in danger.  An investigation is underway and details will be reported as appropriate.  Property damage is estimated to be less than $500. \r\n• Martin Waugh and Doug Osborne (Fluor) arrived Tuesday', 'WMData49');
INSERT INTO `daily_supervisors` VALUES(6, '2010-11-24', -15, -21, 40, 'Mainly clear', '+ Continued working in Opening Cut (Zones 2&3) and Firebag Access (Zones 1,2&3).\r\n', 'WMData49');
INSERT INTO `daily_supervisors` VALUES(7, '2010-11-25', -3, -13, 20, 'Clear', 'TBC continued working in Opening Cut (Zones 2&3) and Firebag Access (Zones 1,2&3).\r\nSixteen (16) additional TBC workers arrvied today.\r\nRig mats were placed over a wet area about 2 kilometers from the Firebag River.  The crossing should be completed Friday.\r\nResolved radio communication tower issue with minimal or no additional cost.', 'WMData4');
INSERT INTO `daily_supervisors` VALUES(8, '2010-11-26', -6, -12, 30, 'Variable Cloudiness', 'TFA was received from the ASRD and the required consultation with their Forest Officer was held in Ft.McMurray this afternoon.\r\nTBC continued working in Opening Cut (Zones 2&3) and Firebag Access (Zones 1,2,3 & 12).\r\nTwenty (20) additional TBC workers arrived today.\r\nCompleted placing rig mats over a wet area about 2 kilometres from the Firebag River. Access to the River is now open for light vehicles.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(9, '2010-11-27', -9, -13, 60, 'Scattered Flurries', 'TBC continued working in Opening Cut (Zones 2&3) and Firebag Access (Zones 1,2,3 & 12).\r\nCompleted on-site alignment meetings with Command and R.EX Contracting management and workers.  Also inspected their equipment and reviewed maintenance procedures including lock-out/tag-out.\r\nTwo (2) additional TBC workers arrived today.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(10, '2010-11-28', -8, -10, 85, 'Variable Cloudiness', 'TBC continued working in Kearl Opening Cut (Zones 2 & 3), Kearl (Zone 4)and Firebag Access (Zones 1, 2, 3 & 12).\r\nTBC began work at the Firebag Bridge.\r\nTwo (2) additional TBC workers arrived.\r\n', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(11, '2010-11-29', -9, -15, 85, 'Fog Patches', 'TBC continued working in Kearl Opening Cut (Zones 2 & 3), Kearl (Zone 4)and Firebag Access (Zones 1, 2, 3 & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, began clearing the Drilling Fluids Sump and leases in the Kearl OCA.\r\nFour (4) additional TBC workers arrived.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(12, '2010-11-30', -7, -13, 79, 'Scattered Flurries', 'TBC continued working in Kearl Opening Cut (Zone 2), Kearl (Zone 1, 3, 4 & 5) and Firebag Access (Zones 1, 2, 3 & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, continued clearing the Sump Area and leases in the Kearl OCA.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(13, '2010-12-01', -6, -10, 85, 'Variable cloudiness', 'TBC continued working in Kearl Opening Cut (Zone 2), Kearl (Zone 1, 3, 4 & 5) and Firebag Access (Zones 1, 2, 3 & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, continued clearing the Sump Area and leases in the Kearl OCA.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(14, '2010-12-02', -10, -12, 70, 'Scattered flurries', 'TBC continued working in Kearl Opening Cut (Zones 2, 3 & 4), Kearl (Zone 1, 6 & 8) and Firebag Access (Zones 1, 2, 3 & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared leases in the Kearl OCA (Zones 4 &5) and Kearl (Zone 6).\r\nTwo (?) additional TBC workers arrived Wednesday and one (1) rotated out on leave', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(15, '2010-12-03', -16, -18, 20, 'Variable cloudiness', 'TBC continued working in Kearl Opening Cut (Zones 2, 3 and 4), Kearl (Zone 1, 6 & 7) and Firebag Access (Zones 1, 2, 3 & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared leases in Kearl (Zones 5, 6 & 16).\r\nIce at the Firebag River Bridge was about 21 inches thick.\r\nCommissioned the 150 ft. VHF Communication System.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(16, '2010-12-04', -11, -15, 0, 'Sunny/clear', '', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(17, '2010-12-05', -9, -10, 10, 'Cloudy periods', '', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(18, '2010-12-06', -12, -18, 20, 'Cloudy periods', 'TBC continued working in Kearl (Zones 1, 2, 3, 4, 5, 6, and 7), the Firebag Access (Zones 3, 4, 5, 6, & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared and mulched leases in Kearl (Zones 1, 6, and 16).\r\nTBC preparation of laydown at Syncrude MLL.\r\nIOL/Fluor completed evaluation of TBC''s recovery planand conducted a review with Calgary Management.\r\nSurveyors profiled the stream bed and ice depths at the Firebag River near the Bridge in preparation for the engineer inspection Wednesday.				', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(19, '2010-12-07', -13, -15, 30, 'Cloudy', 'TBC continued working in Kearl (Zones 1, 2, 3, 4, 5, 6, and 7), the Firebag Access (Zones 3, 4, 5, 6, & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared and mulched leases in Kearl (Zones 1 and 6).\r\nTBC subcontractor, Command, halted clearing and mulching of leases in Kearl (Zones 7) in response to MOC for CODA.\r\nTBC continued preparation of laydown at Syncrude MLL.\r\nTBC commenced construction of Access Roads in Aurora South (Zones 1, 2, 3, 6, and 8).', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(20, '2010-12-08', -12, -14, 70, 'Scattered flurries', 'TBC continued working in Kearl (Zones 1, 2, 3, and 6), the Firebag Access (Zones 4, 5, 6, & 12) and the Firebag Ice Bridge.\r\nConducted load and deflection testing of Firebag Ice Bridge, results favorable pending report.\r\nTBC subcontractor, Command, cleared and mulched leases in Kearl (Zones 1, 6, and 9) and Firebag Access (Zone 7).\r\nTBC continued preparation of laydown at Syncrude MLL.\r\nTBC continued construction of Aurora South Access (Zones 1, 2, 3, 6, and 8).	', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(21, '2010-12-09', -16, -19, 30, 'Variable cloudiness', 'TBC continued working in Kearl (Zones 1, 2, 3, and 6), the Firebag Access (Zones 4, 5, 6, & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared and mulched leases in Kearl (Zone 9), Aurora South (Zones 2 & 3), and Firebag Access (Zone 7 & 8).\r\nTBC continued preparation of laydown at Syncrude MLL.\r\nTBC continued construction of Aurora South Access (Zones 1, 2, 3, 6, and 8).\r\nCommissioned 100'' radio communications tower in Syncrude MLL.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(22, '2010-12-10', -22, -24, 40, 'Variable cloudiness', 'TBC continued working in Kearl (Zones 1, 2, 3, and 6), the Firebag Access (Zones 4, 5, 6, & 12) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared and mulched leases in Kearl (Zone 9), Aurora South (Zones 2 & 3), and Firebag Access (Zone 7 & 8).\r\nTBC continued preparation of laydown at Syncrude MLL.\r\nTBC continued construction of Aurora South Access (Zones 1, 2, 3, 6, and 8).\r\nBST mobilized to site to coach field supervision in observations and approaching others.\r\nReceived Firebag Ice Bridge certification for 20,000 kg loads.', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(23, '2010-12-11', -24, -29, 10, 'Sunny', 'TBC continued work on the Firebag Ice Bridge.\r\nMost TBC equipment on standby due to extreme cold weather.\r\nBST commenced coaching field supervision in observations and approaching others.\r\nBoart Longyear arrived onsite and continues mobilization activities in the Kearl laydown.\r\nBertram Drilling arrived onsite and continues mobilization activities in the Kearl laydown. ', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(24, '2010-12-12', -17, -23, 40, 'Scattered flurries', '', 'WMDataLead');
INSERT INTO `daily_supervisors` VALUES(25, '2010-12-13', -10, -14, 40, 'Few flurries', 'TBC continued working in Kearl (Zones 1, 2, 3, 6, and 9), the Firebag Access (Zones 6, 7, 8, 12, 13, & 14) and the Firebag Ice Bridge.\r\nTBC subcontractor, Command, cleared and mulched leases in Aurora South (Zones 2 & 3), and Firebag Access (Zone 7 & 8).\r\nTBC continued preparation of laydown at Syncrude MLL.\r\nTBC continued construction of Aurora South Access (Zones 1, 2, 3, 6, 8, and 9).\r\nBST continued coaching TBC field supervision in observations and approaching others.\r\nBoart Longyear commenced sonic coring on K2GT11-083.\r\nBertram Drilling continued mobilization activities to KC11-010 and KC11-040.	', 'WMDataLead');
