INSERT INTO `wm_dailysafety` VALUES(1, 'WMData2', 'Slippery and cold', 'N/A', 0, 0, 0, 'Laydown', 1, '2010-11-19', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(2, 'WMData49', 'Orientations ', 'Today following was completed:\r\n2 JFA\r\n1 Toolbox Talk\r\n1 Safety Meeting\r\n1 Orientation\r\n', 0, 0, 0, 'Kearl', 1, '2010-11-20', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(3, 'WMData49', 'Winter Driving', 'First weekly safety meeting 05:30 and 15:30. Rerviewed AFP radio system and Winter driving', 0, 0, 0, 'OCA', 1, '2010-11-21', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(4, 'WMData49', 'Winter Driving', 'Night Shift. Thompson Brothers crew working 2 dozers in Opening Cut Area, and 1 dozer at the Com. Tower.  No incidents. ', 0, 0, 0, 'OCA', 1, '2010-11-22', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(5, 'WMData47', 'Using Tiger Tourch', 'Night Shift. Attended Tool Box Meeting with Thompson Brothers. Attended night Orientation  for Thompson Brothers employees.  2 Dozers dragging tires in O.C.A, and 1 tractor dragging tires on line 11 towards Firebag. No incidents.\r\n\r\nDay Shift: Millard B, Terry H and Gord Fulton attended TBC Cross Shift/ Tool Box Safety meeting 05:30. Safety topic Light Tower awareness.\r\ngood interaction with crew on possible pinch points and line of fire while working on and setting up taking down light towers.\r\nGord Fulton con''t to review and work with TBC on the Command Equipment Critical Risk Assessment, A&D and Green Hand policy.  ', 0, 0, 0, 'OCA', 1, '2010-11-23', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(6, 'WMData47', 'Towing equipment; highlighting damage to light plant incident. Importance of maintaining clean equipment cabs.', 'Night Shift:\r\nObserve Thompson Bros working in OCA and Fire Bag Access road.TBC had to tow a water truck in the OCA area due to soft ground.TBC towing procedures were obtained reviewed and signed off with all participating crew members.\r\nDayShift:\r\nFLRA review in OCA (rating 4). JSA review OCA (rating 4). Attend towing procedure and JSA meeting OCA light vehicle 10:20. Site inspection and FLRA review at Kearl water source #1 (rating 4).Site tour with Doug Osborne and Allen K out the Fire Bag access road, FLRA review on cat operator (rating 4) and TBC superintendent (rating 4). Review TBC incident report on Property Damage to Light Tower unit # 1175564.', 0, 0, 0, 'OCA', 1, '2010-11-24', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(7, 'WMDataLead', 'Obseving hazards: specific examples of never walking past an unsafe act.  ', 'Night Shift \r\nwe had a water truck stuck again last night , JSA reviewed and truck was towed out.\r\nNo other incidents.\r\nDay Shift:\r\nGord Fulton, Doug Osborne attend TBC cross shift/safety/toolbox meeting. In the field conducting FLRA/JSA review/mentoring.One tow of water truck in OCA, attend pre tow meeting all procedures followed.\r\n', 0, 0, 0, 'Kearl OCA', 1, '2010-11-25', '0000-00-00 00:00:00');
INSERT INTO `wm_dailysafety` VALUES(8, 'WMData48', '', 'None', 0, 0, 0, 'Kearl', 1, '2010-11-26', '0000-00-00 00:00:00');
